import React from 'react'
import useFetch from './Components/CustomHooks/useFetch'

function App() {
  const {data, loading, msg} = useFetch('https://enigmatic-cove-89902.herokuapp.com/api/v1/test')
  return (
    <div>
    <h2>App</h2>
    {loading &&  <div>Loading...</div>}
    {msg &&  <div>{msg}</div>}

    {data.map((item)=>{
      return <>
        <p>{item.name}</p>
      </>
    })}
    </div>
  )
}

export default App
